import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

// Import your page components
const Nosotros = () => <div className="page"><h1>Nosotros</h1></div>;
const QuienesSomos = () => <div className="page"><h1>Quienes Somos</h1></div>;
const Contacto = () => <div className="page"><h1>Contacto</h1></div>;

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="nav-links">
            <Link to="/nosotros" className="nav-link">Nosotros</Link>
            <Link to="/quienes-somos" className="nav-link">Quienes Somos</Link>
            <Link to="/contacto" className="nav-link">Contacto</Link>
          </div>
        </nav>

        <main className="main-content">
          <Routes>
            <Route path="/nosotros" element={<Nosotros />} />
            <Route path="/quienes-somos" element={<QuienesSomos />} />
            <Route path="/contacto" element={<Contacto />} />
            <Route path="/" element={<Nosotros />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
